  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset has measurements of the size
  of selected animal species at selected locations in the Channel Islands National
  Park. Sampling is conducted annually between the months of May-October, so the Time
  data in this file is July 1 of each year (a nominal value). The size frequency measurements
  were taken within 10 meters of the transect line at each site.  Depths at the site
  vary some, but we describe the depth of the site along the transect line where that
  station's temperature logger is located, a typical depth for the site.\",\n\t\"license_title\":
